import "./App.css";
import Three from "./components/Three";
import Merge from "./components/Merge";
import Four from "./components/Four";

function fetchWeather(country, apiKey) {
  return fetch(
    `https://api.openweathermap.org/data/2.5/weather?q=${country}&units=metric&appid=${apiKey}`
  )
    .then((response) => response.json())
    .then((data) => {
      console.log(data); // Log the weather data to the console
      return data;
    })
    .catch((error) => {
      console.error("Error fetching weather data:", error);
      return null;
    });
}

console.log(fetchWeather("Islamabad", "baafed74ddd9f05c52673a3bd435bb33"));

function App() {
  return (
    <>
    <div className="relative">
  <input
    type="text"
    className="border border-gray-300 bg-white h-10 px-5 pr-10 rounded-full text-sm focus:outline-none"
    placeholder="Search..."
  />
  <button className="absolute right-0 top-0 mt-3 mr-4">
    <svg
      xmlns="http://www.w3.org/2000/svg"
      className="h-4 w-4 fill-current text-gray-400"
      viewBox="0 0 24 24"
    >
      <path
        fillRule="evenodd"
        d="M16.5 15h-.79l-.28-.27a6.5 6.5 0 0 0 1.48-5.34c-.47-2.78-2.79-5-5.59-5.34a6.505 6.505 0 0 0-7.27 7.27c.34 2.8 2.56 5.12 5.34 5.59a6.5 6.5 0 0 0 5.34-1.48l.27.28v.79l4.25 4.25c.41.41 1.08.41 1.49 0 .41-.41.41-1.08 0-1.49L16.5 15zm-5 0C7.01 15 3 10.99 3 6.5S7.01 2 11.5 2 20 6.01 20 10.5 15.99 19 11.5 19z"
      />
    </svg>Pess
  </button>
</div>

      <div className="App flex flex-row bg-red-300">
        <div className="w-1/2 p-4">
          <Merge />
        </div>
        <div className="w-1/2 p-4">
          <Three />
        </div>
      </div>
      <Four />
    </>
  );
}

export default App;
